// Fireplace.js
import React from 'react';

const fireplaceImages = [
  {
    image: 'fireplace1.jpg',
    title: 'Fire Place 01',

  },
  {
    image: 'fireplace2.jpg',
    title: 'Fire Place 02',
  },
  {
    image: 'fireplace3.jpg',
    title: 'Fire Place 03',

  },
  {
    image: 'fireplace4.jpg',
    title: 'Fire Place 04',

  },
  {
    image: 'fireplace5.jpg',
    title: 'Fire Place 05',

  },
  {
    image: 'fireplace6.jpg',
    title: 'Fire Place 06',

  },
];

function FirePlace() {
  return (
    <div className="right-container">
      <div className="row">
        {fireplaceImages.slice(0, 3).map((product, index) => (
          <div key={index} className="col-md-4 mb-5">
            <img src={product.image} alt={product.title} className="stone-img" />
            <h5>{product.title}</h5>
               
          </div>
        ))}
      </div>
      <div className="row">
        {fireplaceImages.slice(3, 6).map((product, index) => (
          <div key={index} className="col-md-4 mb-5">
          <img src={product.image} alt={product.title} className="stone-img" />
          <h5>{product.title}</h5>
             
        </div>
        ))}
      </div>
    </div>
  );
}

export default FirePlace;
